import React, { useState, useEffect } from 'react';
import { db } from "../../utils/firebaseConfig";


export const createProfil = (res, comment) => {

  return db.collection("Profil").doc(res.user.uid).set({
    uid: res.user.uid,
    name: res.user.displayName,
    commentary: comment
  })
}
